import React from "react";

import styled from "styled-components";

const OrdersWrapper = styled.div`
  height: 30vh;
  width: 70vh;
  background-color: white;
`;

export const OverdueOrders = () => {

  return (
    <OrdersWrapper>
      <h3>Overdue Orders</h3>
    </OrdersWrapper>
  );

}
